"use strict";
const COLORS = ['red', 'green', 'rgb(122, 155, 100)', '#f17025'];
const main = document.querySelector('.main');
const btn = document.querySelector('.btn');
const colorDefault = document.querySelector('.color-default');
const simple = document.querySelector('.simple');
simple.style.color = '#0af';
const changeColor = () => {
    let indexRandom = Math.random() * COLORS.length;
    main.style.backgroundColor = COLORS[Math.floor(indexRandom)];
    colorDefault.innerText = COLORS[Math.floor(indexRandom)];
};
btn.addEventListener('click', changeColor);
